/** *	HtmlLoad navigator * *	@param container selector *	@param loadurl URL ***/ServiceClient.jquery.navigator.HtmlLoad = function(config){	return [{		service : ServiceClient.jquery.view.ElementView,		elementid : config.container	},{		service : ServiceClient.jquery.loader.AjaxLoader,		loadurl : config.loadurl,		datatype : 'html',		workflow : [{			service : ServiceClient.jquery.renderer.ContentUI		}]	}];}